import React from 'react';
import './AnaSayfa.css';

const AnaSayfa = () => {
  return (
    <div className="ana-sayfa">
      <div className="logo-container">
        <img 
          src="/resimler/logo.png" 
          alt="FutbolAnaliz Logo" 
          className="ana-sayfa-logo"
        />
      </div>
      <h1>Futbol Analiz'e Hoş Geldiniz</h1>
      <div className="ana-sayfa-content">
        <p>Futbol dünyasının tüm istatistikleri ve analizleri burada!</p>
      </div>
    </div>
  );
};

export default AnaSayfa;
